// Import Styled
import styled from 'styled-components';

export const TagDefault = styled.text`
	border-radius: 16px;
	background-color: #79828b1a;
	color: #8D99A4;
	font-family: 'Roboto Mono', monospace;
	font-weight: 500;
	font-size: 16px;
	line-height: 21px;
	letter-spacing: 0.75px;
    padding: 4px 12px 7px;
`;
